import "../Components/Home.css"
let text = "Text 1";



export function texty(){
    function changetext(){

        for (let i = 0; i < 10; i++) {
          if (text === "Text 1") {
            text = "Text 2";
          } 
          if(text === "Text 2"){
            text = "Text 2"
          }
          document.getElementById("changing-text").innerHTML = text;
        }
    }
      
}
